pragma solidity >=0.6.6;

import './interfaces/ITeleswapV2ERC20.sol';
import './libraries/SafeMath.sol';

contract TeleswapV2ERC20 is ITeleswapV2ERC20 {
    using SafeMath for uint;

    string public  override name = 'Teleswap V2';
    string public  override symbol = 'TELE-V2';
    uint8 public constant override decimals = 18;
    uint  public override totalSupply;
    mapping(address => uint) public override balanceOf;
    mapping(address => mapping(address => uint)) public override allowance;

    bytes32 public override DOMAIN_SEPARATOR;
    // keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)");
    bytes32 public constant override PERMIT_TYPEHASH = 0x6e71edae12b1b97f4d1f60370fef10105fa2faae0126114a169c64845d6126c9;
    mapping(address => uint) public override nonces;

    event Approval(address indexed owner, address indexed spender, uint value);
    event Transfer(address indexed from, address indexed to, uint value);

    constructor() public {
        uint chainId;
        assembly {
            chainId := chainid()
        }
        DOMAIN_SEPARATOR = keccak256(
            abi.encode(
                keccak256('EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)'),
                keccak256(bytes(name)),
                keccak256(bytes('1')),
                chainId,
                address(this)
            )
        );
    }

    function _mint(address to, uint value) internal {
        totalSupply = totalSupply.add(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(address(0), to, value);
    }

    function _burn(address from, uint value) internal {
        balanceOf[from] = balanceOf[from].sub(value);
        totalSupply = totalSupply.sub(value);
        emit Transfer(from, address(0), value);
    }

    function _approve(address owner, address spender, uint value) private {
        allowance[owner][spender] = value;
        emit Approval(owner, spender, value);
    }

    function _transfer(address from, address to, uint value) private {
        balanceOf[from] = balanceOf[from].sub(value);
        balanceOf[to] = balanceOf[to].add(value);
        emit Transfer(from, to, value);
    }

    function approve(address spender, uint value) override external returns (bool) {
        _approve(msg.sender, spender, value);
        return true;
    }

    function transfer(address to, uint value) override external returns (bool) {
        _transfer(msg.sender, to, value);
        return true;
    }

    function transferFrom(address from, address to, uint value) override virtual external returns (bool) {
        if (allowance[from][msg.sender] != uint(-1)) {
            allowance[from][msg.sender] = allowance[from][msg.sender].sub(value);
        }
        _transfer(from, to, value);
        return true;
    }

    function permit(address owner, address spender, uint value, uint deadline, uint8 v, bytes32 r, bytes32 s) override external {
        require(deadline >= block.timestamp, 'TeleswapV2: EXPIRED');
        bytes32 digest = keccak256(
            abi.encodePacked(
                '\x19\x01',
                DOMAIN_SEPARATOR,
                keccak256(abi.encode(PERMIT_TYPEHASH, owner, spender, value, nonces[owner]++, deadline))
            )
        );
        address recoveredAddress = ecrecover(digest, v, r, s);
        require(recoveredAddress != address(0) && recoveredAddress == owner, 'TeleswapV2: INVALID_SIGNATURE');
        _approve(owner, spender, value);
    }
}

contracts/TeleswapV2Factory.sol.content:
pragma solidity >=0.6.6;

import './interfaces/ITeleswapV2Factory.sol';
import './TeleswapV2Pair.sol';

contract TeleswapV2Factory is ITeleswapV2Factory {
    address public override feeTo;
    address public override feeToSetter;

    mapping(address => mapping(address => mapping(bool => address))) public override getPair;
    address[] public override allPairs;

    event PairCreated(address indexed token0, address indexed token1, bool stable, address pair, uint);

        constructor(address _feeToSetter) public {
            feeToSetter = _feeToSetter;
        }

    function allPairsLength() override external view returns (uint) {
        return allPairs.length;
    }

    function createPair(address tokenA, address tokenB, bool stable) override external returns (address pair) {
        require(tokenA != tokenB, 'TeleswapV2: IDENTICAL_ADDRESSES');
        // BaseV1: IDENTICAL_ADDRESSES
        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
        require(token0 != address(0), 'TeleswapV2: ZERO_ADDRESS');
        // BaseV1: ZERO_ADDRESS
        require(getPair[token0][token1][stable] == address(0), 'TeleswapV2: PAIR_EXISTS');
        // BaseV1: PAIR_EXISTS - single check is sufficient
        bytes32 salt = keccak256(abi.encodePacked(token0, token1, stable));
        // notice salt includes stable as well, 3 parameters
        bytes memory bytecode = type(TeleswapV2Pair).creationCode;
        assembly {
            pair := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        // init pair
        TeleswapV2Pair(pair).initialize(token0, token1, stable);

        // update factory state
        getPair[token0][token1][stable] = pair;
        getPair[token1][token0][stable] = pair;
        // populate mapping in the reverse direction
        allPairs.push(pair);

        emit PairCreated(token0, token1, stable, pair, allPairs.length);
    }

    function setFeeTo(address _feeTo) override external {
        require(msg.sender == feeToSetter, 'TeleswapV2: FORBIDDEN');
        feeTo = _feeTo;
    }

    function setFeeToSetter(address _feeToSetter) override external {
        require(msg.sender == feeToSetter, 'TeleswapV2: FORBIDDEN');
        feeToSetter = _feeToSetter;
    }

    /**
     * For solving the CREATE2 problem in a easier way
     */
    function pairInitCodeHash() override public pure returns (bytes32) {
        return keccak256(type(TeleswapV2Pair).creationCode);
    }
}

contracts/TeleswapV2Pair.sol.content:
pragma solidity >=0.6.6;

import './interfaces/ITeleswapV2Pair.sol';
import './TeleswapV2ERC20.sol';
import './libraries/Math.sol';
import './libraries/UQ112x112.sol';
import './interfaces/IERC20.sol';
import './interfaces/ITeleswapV2Factory.sol';
import './interfaces/ITeleswapV2Callee.sol';

contract TeleswapV2Pair is TeleswapV2ERC20 {
    using SafeMath  for uint;
    using UQ112x112 for uint224;

    // Used to denote stable or volatile pair, not immutable since construction happens in the initialize method for CREATE2 deterministic addresses
    bool public stable;

    uint public constant MINIMUM_LIQUIDITY = 10 ** 3;
    bytes4 private constant SELECTOR = bytes4(keccak256(bytes('transfer(address,uint256)')));

    address public factory;
    address public token0;
    address public token1;
    uint internal  decimals0;
    uint internal  decimals1;


    uint112 private reserve0;           // uses single storage slot, accessible via getReserves
    uint112 private reserve1;           // uses single storage slot, accessible via getReserves
    uint32  private blockTimestampLast; // uses single storage slot, accessible via getReserves

    uint public price0CumulativeLast;
    uint public price1CumulativeLast;
    uint public kLast; // reserve0 * reserve1, as of immediately after the most recent liquidity event

    uint private unlocked = 1;
    modifier lock() {
        require(unlocked == 1, 'TeleswapV2: LOCKED');
        unlocked = 0;
        _;
        unlocked = 1;
    }

    function getReserves() public view returns (uint112 _reserve0, uint112 _reserve1, uint32 _blockTimestampLast) {
        _reserve0 = reserve0;
        _reserve1 = reserve1;
        _blockTimestampLast = blockTimestampLast;
    }

    function _safeTransfer(address token, address to, uint value) private {
        (bool success, bytes memory data) = token.call(abi.encodeWithSelector(SELECTOR, to, value));
        require(success && (data.length == 0 || abi.decode(data, (bool))), 'TeleswapV2: TRANSFER_FAILED');
    }

    event Mint(address indexed sender, uint amount0, uint amount1);
    event Burn(address indexed sender, uint amount0, uint amount1, address indexed to);
    event Swap(
        address indexed sender,
        uint amount0In,
        uint amount1In,
        uint amount0Out,
        uint amount1Out,
        address indexed to
    );
    event Sync(uint112 reserve0, uint112 reserve1);

    constructor() public {
        factory = msg.sender;
    }

    // called once by the factory at time of deployment
    function initialize(address _token0, address _token1, bool _stable) external {
        require(msg.sender == factory, 'TeleswapV2: FORBIDDEN');
        // sufficient check
        token0 = _token0;
        token1 = _token1;
        stable = _stable;
        if (_stable) {
            name = string(abi.encodePacked("StableV1 AMM - ", ITeleswapV2ERC20(_token0).symbol(), "/", ITeleswapV2ERC20(_token1).symbol()));
            symbol = string(abi.encodePacked("sAMM-", ITeleswapV2ERC20(_token0).symbol(), "/", ITeleswapV2ERC20(_token1).symbol()));
            uint tmp0 = IERC20(_token0).decimals();
            uint tmp1 = IERC20(_token1).decimals();
            decimals0 = 10 ** tmp0;
            decimals1 = 10 ** tmp1;
        } else {
            name = string(abi.encodePacked("VolatileV1 AMM - ", ITeleswapV2ERC20(_token0).symbol(), "/", ITeleswapV2ERC20(_token1).symbol()));
            symbol = string(abi.encodePacked("vAMM-", ITeleswapV2ERC20(_token0).symbol(), "/", ITeleswapV2ERC20(_token1).symbol()));
        }
    }

    // update reserves and, on the first call per block, price accumulators
    function _update(uint balance0, uint balance1, uint112 _reserve0, uint112 _reserve1) private {
        require(balance0 <= uint112(- 1) && balance1 <= uint112(- 1), 'TeleswapV2: OVERFLOW');
        uint32 blockTimestamp = uint32(block.timestamp % 2 ** 32);
        uint32 timeElapsed = blockTimestamp - blockTimestampLast;
        // overflow is desired
        if (timeElapsed > 0 && _reserve0 != 0 && _reserve1 != 0) {
            // * never overflows, and + overflow is desired
            price0CumulativeLast += uint(UQ112x112.encode(_reserve1).uqdiv(_reserve0)) * timeElapsed;
            price1CumulativeLast += uint(UQ112x112.encode(_reserve0).uqdiv(_reserve1)) * timeElapsed;
        }
        reserve0 = uint112(balance0);
        reserve1 = uint112(balance1);
        blockTimestampLast = blockTimestamp;
        emit Sync(reserve0, reserve1);
    }

    // if fee is on, mint liquidity equivalent to 1/6th of the growth in sqrt(k)
    function _mintFee(uint112 _reserve0, uint112 _reserve1) private returns (bool feeOn) {
        address feeTo = ITeleswapV2Factory(factory).feeTo();
        feeOn = feeTo != address(0);
        uint _kLast = kLast;
        // gas savings
        if (feeOn) {
            if (_kLast != 0) {
                uint rootK = Math.sqrt(uint(_reserve0).mul(_reserve1));
                uint rootKLast = Math.sqrt(_kLast);
                if (rootK > rootKLast) {
                    uint numerator = totalSupply.mul(rootK.sub(rootKLast));
                    uint denominator = rootK.mul(5).add(rootKLast);
                    uint liquidity = numerator / denominator;
                    if (liquidity > 0) _mint(feeTo, liquidity);
                }
            }
        } else if (_kLast != 0) {
            kLast = 0;
        }
    }

    // this low-level function should be called from a contract which performs important safety checks
    function mint(address to) external lock returns (uint liquidity) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        // gas savings
        uint balance0 = IERC20(token0).balanceOf(address(this));
        uint balance1 = IERC20(token1).balanceOf(address(this));
        uint amount0 = balance0.sub(_reserve0);
        uint amount1 = balance1.sub(_reserve1);

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply;
        // gas savings, must be defined here since totalSupply can update in _mintFee
        if (_totalSupply == 0) {
            liquidity = Math.sqrt(amount0.mul(amount1)).sub(MINIMUM_LIQUIDITY);
            _mint(address(0), MINIMUM_LIQUIDITY);
            // permanently lock the first MINIMUM_LIQUIDITY tokens
        } else {
            liquidity = Math.min(amount0.mul(_totalSupply) / _reserve0, amount1.mul(_totalSupply) / _reserve1);
        }
        require(liquidity > 0, 'TeleswapV2: INSUFFICIENT_LIQUIDITY_MINTED');
        _mint(to, liquidity);

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) kLast = uint(reserve0).mul(reserve1);
        // reserve0 and reserve1 are up-to-date
        emit Mint(msg.sender, amount0, amount1);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function burn(address to) external lock returns (uint amount0, uint amount1) {
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        // gas savings
        address _token0 = token0;
        // gas savings
        address _token1 = token1;
        // gas savings
        uint balance0 = IERC20(_token0).balanceOf(address(this));
        uint balance1 = IERC20(_token1).balanceOf(address(this));
        uint liquidity = balanceOf[address(this)];

        bool feeOn = _mintFee(_reserve0, _reserve1);
        uint _totalSupply = totalSupply;
        // gas savings, must be defined here since totalSupply can update in _mintFee
        amount0 = liquidity.mul(balance0).div(_totalSupply);
        // using balances ensures pro-rata distribution
        amount1 = liquidity.mul(balance1).div(_totalSupply);
        // using balances ensures pro-rata distribution
        require(amount0 > 0 && amount1 > 0, 'TeleswapV2: INSUFFICIENT_LIQUIDITY_BURNED');
        _burn(address(this), liquidity);
        _safeTransfer(_token0, to, amount0);
        _safeTransfer(_token1, to, amount1);
        balance0 = IERC20(_token0).balanceOf(address(this));
        balance1 = IERC20(_token1).balanceOf(address(this));

        _update(balance0, balance1, _reserve0, _reserve1);
        if (feeOn) kLast = uint(reserve0).mul(reserve1);
        // reserve0 and reserve1 are up-to-date
        emit Burn(msg.sender, amount0, amount1, to);
    }

    // this low-level function should be called from a contract which performs important safety checks
    function swap(uint amount0Out, uint amount1Out, address to, bytes calldata data) external lock {
        require(amount0Out > 0 || amount1Out > 0, 'TeleswapV2: INSUFFICIENT_OUTPUT_AMOUNT');
        (uint112 _reserve0, uint112 _reserve1,) = getReserves();
        // gas savings
        require(amount0Out < _reserve0 && amount1Out < _reserve1, 'TeleswapV2: INSUFFICIENT_LIQUIDITY');

        uint balance0;
        uint balance1;
        {// scope for _token{0,1}, avoids stack too deep errors
            address _token0 = token0;
            address _token1 = token1;
            require(to != _token0 && to != _token1, 'TeleswapV2: INVALID_TO');
            if (amount0Out > 0) _safeTransfer(_token0, to, amount0Out);
            // optimistically transfer tokens
            if (amount1Out > 0) _safeTransfer(_token1, to, amount1Out);
            // optimistically transfer tokens
            if (data.length > 0) ITeleswapV2Callee(to).uniswapV2Call(msg.sender, amount0Out, amount1Out, data);
            balance0 = IERC20(_token0).balanceOf(address(this));
            balance1 = IERC20(_token1).balanceOf(address(this));
        }
        uint amount0In = balance0 > _reserve0 - amount0Out ? balance0 - (_reserve0 - amount0Out) : 0;
        uint amount1In = balance1 > _reserve1 - amount1Out ? balance1 - (_reserve1 - amount1Out) : 0;
        require(amount0In > 0 || amount1In > 0, 'TeleswapV2: INSUFFICIENT_INPUT_AMOUNT');
        {// scope for reserve{0,1}Adjusted, avoids stack too deep errors
            uint balance0Adjusted = balance0.mul(1000).sub(amount0In.mul(3));
            uint balance1Adjusted = balance1.mul(1000).sub(amount1In.mul(3));
            require(_k(balance0Adjusted, balance1Adjusted) >= _k(_reserve0, _reserve1), 'TeleswapV2: K');
        }

        _update(balance0, balance1, _reserve0, _reserve1);
        emit Swap(msg.sender, amount0In, amount1In, amount0Out, amount1Out, to);
    }

    function _k(uint x, uint y) internal view returns (uint) {
        if (stable) {
            uint _x = x.mul(1e18).div(decimals0);
            uint _y = y.mul(1e18).div(decimals1);
            uint _a = _x.mul(_y).div(1e18);
            uint _b = (((_x.mul(_x)).div(1e18)).add((_y.mul(_y).div(1e18))));
            return _a.mul(_b).div(1e18);
            // x3y+y3x >= k
        } else {
            return x.mul(y);
            // xy >= k
        }
    }

    // force balances to match reserves
    function skim(address to) external lock {
        address _token0 = token0;
        // gas savings
        address _token1 = token1;
        // gas savings
        _safeTransfer(_token0, to, IERC20(_token0).balanceOf(address(this)).sub(reserve0));
        _safeTransfer(_token1, to, IERC20(_token1).balanceOf(address(this)).sub(reserve1));
    }

    // force reserves to match balances
    function sync() external lock {
        _update(IERC20(token0).balanceOf(address(this)), IERC20(token1).balanceOf(address(this)), reserve0, reserve1);
    }
}

contracts/TeleswapV2Router02.sol.content:
pragma solidity >=0.6.6;
pragma experimental ABIEncoderV2;

import './interfaces/ITeleswapV2Factory.sol';
import '@uniswap/lib/contracts/libraries/TransferHelper.sol';

import './interfaces/ITeleswapV2Router02.sol';
import './libraries/TeleswapV2Library.sol';
import './libraries/SafeMath.sol';
import './interfaces/IERC20.sol';
import './interfaces/IWETH.sol';

contract TeleswapV2Router02 is ITeleswapV2Router02 {
    using SafeMath for uint;

    address public override factory;
    address public override WETH;
    bytes32  pairCodeHash;




    modifier ensure(uint deadline) {
        require(deadline >= block.timestamp, 'TeleswapV2Router: EXPIRED');
        _;
    }

    constructor(address _factory, address _WETH) public {
        factory = _factory;
        WETH = _WETH;
        pairCodeHash = ITeleswapV2Factory(_factory).pairInitCodeHash();
    }


    receive() external payable {
        assert(msg.sender == WETH);
        // only accept ETH via fallback from the WETH contract
    }

    // **** ADD LIQUIDITY ****
    function _addLiquidity(
        route memory _route,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin
    ) internal virtual returns (uint amountA, uint amountB) {
        // create the pair if it doesn't exist yet
        address _pair = ITeleswapV2Factory(factory).getPair(_route.from, _route.to, _route.stable);
        if (_pair == address(0)) {
            _pair = ITeleswapV2Factory(factory).createPair(_route.from, _route.to, _route.stable);
        }
        (uint reserveA, uint reserveB) = TeleswapV2Library.getReserves(factory, _route);
        if (reserveA == 0 && reserveB == 0) {
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            uint amountBOptimal = TeleswapV2Library.quote(amountADesired, reserveA, reserveB);
            if (amountBOptimal <= amountBDesired) {
                require(amountBOptimal >= amountBMin, 'TeleswapV2Router: INSUFFICIENT_B_AMOUNT');
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                uint amountAOptimal = TeleswapV2Library.quote(amountBDesired, reserveB, reserveA);
                assert(amountAOptimal <= amountADesired);
                require(amountAOptimal >= amountAMin, 'TeleswapV2Router: INSUFFICIENT_A_AMOUNT');
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }

    function addLiquidity(
        route calldata _route,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) returns (uint amountA, uint amountB, uint liquidity) {
        (amountA, amountB) = _addLiquidity(_route, amountADesired, amountBDesired, amountAMin, amountBMin);
        address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
        TransferHelper.safeTransferFrom(_route.from, msg.sender, pair, amountA);
        TransferHelper.safeTransferFrom(_route.to, msg.sender, pair, amountB);
        liquidity = ITeleswapV2Pair(pair).mint(to);
    }

    function addLiquidityETH(
        route calldata _route,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external virtual override payable ensure(deadline) returns (uint amountToken, uint amountETH, uint liquidity) {
        (amountToken, amountETH) = _addLiquidity(
            _route,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountETHMin
        );
        address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
        TransferHelper.safeTransferFrom(_route.from, msg.sender, pair, amountToken);
        IWETH(WETH).deposit{value : amountETH}();
        assert(IWETH(WETH).transfer(pair, amountETH));
        liquidity = ITeleswapV2Pair(pair).mint(to);
        // refund dust eth, if any
        if (msg.value > amountETH) TransferHelper.safeTransferETH(msg.sender, msg.value - amountETH);
    }

    // **** REMOVE LIQUIDITY ****
    function removeLiquidity(
        route memory _route,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) public virtual override ensure(deadline) returns (uint amountA, uint amountB) {
        address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
        ITeleswapV2Pair(pair).transferFrom(msg.sender, pair, liquidity);
        // send liquidity to pair
        (uint amount0, uint amount1) = ITeleswapV2Pair(pair).burn(to);
        (address token0,) = TeleswapV2Library.sortTokens(_route.from, _route.to);
        (amountA, amountB) = _route.from == token0 ? (amount0, amount1) : (amount1, amount0);
        require(amountA >= amountAMin, 'TeleswapV2Router: INSUFFICIENT_A_AMOUNT');
        require(amountB >= amountBMin, 'TeleswapV2Router: INSUFFICIENT_B_AMOUNT');
    }

    function removeLiquidityETH(
        route calldata _route,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) returns (uint amountToken, uint amountETH) {
        (amountToken, amountETH) = removeLiquidity(
            _route,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        TransferHelper.safeTransfer(_route.from, to, amountToken);
        IWETH(WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityWithPermit(
        route calldata _route,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline,
        bool approveMax, Sig calldata sig
    ) external virtual override returns (uint amountA, uint amountB) {
        address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
        uint value = approveMax ? uint(- 1) : liquidity;
        ITeleswapV2Pair(pair).permit(msg.sender, address(this), value, deadline, sig.v, sig.r, sig.s);
        (amountA, amountB) = removeLiquidity(_route, liquidity, amountAMin, amountBMin, to, deadline);
    }

    function removeLiquidityETHWithPermit(
        route calldata _route,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, Sig calldata sig
    ) external virtual override returns (uint amountToken, uint amountETH) {
        {
            address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
            uint value = approveMax ? uint(- 1) : liquidity;
            ITeleswapV2Pair(pair).permit(msg.sender, address(this), value, deadline, sig.v, sig.r, sig.s);
        }

        {
            (amountToken, amountETH) = this.removeLiquidityETH(_route, liquidity, amountTokenMin, amountETHMin, to, deadline);
        }

    }

    // **** REMOVE LIQUIDITY (supporting fee-on-transfer tokens) ****
    function removeLiquidityETHSupportingFeeOnTransferTokens(
        route memory _route,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) public virtual override ensure(deadline) returns (uint amountETH) {
        (, amountETH) = removeLiquidity(
            _route,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        TransferHelper.safeTransfer(_route.from, to, IERC20(_route.from).balanceOf(address(this)));
        IWETH(WETH).withdraw(amountETH);
        TransferHelper.safeTransferETH(to, amountETH);
    }

    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        route calldata _route,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, Sig calldata sig
    ) external virtual override returns (uint amountETH) {
        address pair = TeleswapV2Library.pairFor(pairCodeHash, factory, _route);
        uint value = approveMax ? uint(- 1) : liquidity;
        ITeleswapV2Pair(pair).permit(msg.sender, address(this), value, deadline, sig.v, sig.r, sig.s);
        amountETH = removeLiquidityETHSupportingFeeOnTransferTokens(
            _route, liquidity, amountTokenMin, amountETHMin, to, deadline
        );
    }

    // **** SWAP ****
    // requires the initial amount to have already been sent to the first pair
    function _swap(uint[] memory amounts, route[] memory routes, address _to) internal virtual {
        for (uint i; i <= routes.length - 1; i++) {
            (address input, address output) = (routes[i].from, routes[i].to);
            (address token0,) = TeleswapV2Library.sortTokens(input, output);
            uint amountOut = amounts[i + 1];
            (uint amount0Out, uint amount1Out) = input == token0 ? (uint(0), amountOut) : (amountOut, uint(0));
            address to = i < routes.length - 1 ? TeleswapV2Library.pairFor(pairCodeHash, factory, routes[i + 1]) : _to;
            ITeleswapV2Pair(TeleswapV2Library.pairFor(pairCodeHash, factory, routes[i])).swap(
                amount0Out, amount1Out, to, new bytes(0)
            );
        }
    }

    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        route[] calldata routes,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) returns (uint[] memory amounts) {
        amounts = getAmountsOut(amountIn, routes);
        require(amounts[amounts.length - 1] >= amountOutMin, 'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT');
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amountIn);
        _swap(amounts, routes, to);
    }

    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        route[] calldata routes,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) returns (uint[] memory amounts) {
        amounts = getAmountsIn(amountOut, routes);
        require(amounts[0] <= amountInMax, 'TeleswapV2Router: EXCESSIVE_INPUT_AMOUNT');
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]
        );
        _swap(amounts, routes, to);
    }

    function swapExactETHForTokens(uint256 amountIn, uint amountOutMin, route[] calldata routes, address to, uint deadline)
    external
    virtual
    override
    payable
    ensure(deadline)
    returns (uint[] memory amounts)
    {
        require(routes[0].from == WETH, 'TeleswapV2Router: INVALID_PATH');
        require(amountIn <= msg.value, 'TeleswapV2Router: INVALID_MSG_VALUE');
        amounts = getAmountsOut(amountIn, routes);
        require(amounts[amounts.length - 1] >= amountOutMin, 'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT');
        IWETH(WETH).deposit{value : amounts[0]}();
        assert(IWETH(WETH).transfer(TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]));
        _swap(amounts, routes, to);
    }

    function swapTokensForExactETH(uint amountOut, uint amountInMax, route[] calldata routes, address to, uint deadline)
    external
    virtual
    override
    ensure(deadline)
    returns (uint[] memory amounts)
    {
        require(routes[routes.length - 1].to == WETH, 'TeleswapV2Router: INVALID_PATH');
        amounts = getAmountsIn(amountOut, routes);
        require(amounts[0] <= amountInMax, 'TeleswapV2Router: EXCESSIVE_INPUT_AMOUNT');
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]
        );
        _swap(amounts, routes, address(this));
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    function swapExactTokensForETH(uint amountIn, uint amountOutMin, route[] calldata routes, address to, uint deadline)
    external
    virtual
    override
    ensure(deadline)
    returns (uint[] memory amounts)
    {
        require(routes[routes.length - 1].to == WETH, 'TeleswapV2Router: INVALID_PATH');
        amounts = getAmountsOut(amountIn, routes);
        require(amounts[amounts.length - 1] >= amountOutMin, 'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT');
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]
        );
        _swap(amounts, routes, address(this));
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    function swapETHForExactTokens(uint amountOut, route[] calldata routes, address to, uint deadline)
    external
    virtual
    override
    payable
    ensure(deadline)
    returns (uint[] memory amounts)
    {
        require(routes[0].from == WETH, 'TeleswapV2Router: INVALID_PATH');
        amounts = getAmountsIn(amountOut, routes);
        require(amounts[0] <= msg.value, 'TeleswapV2Router: EXCESSIVE_INPUT_AMOUNT');
        IWETH(WETH).deposit{value : amounts[0]}();
        assert(IWETH(WETH).transfer(TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]));
        _swap(amounts, routes, to);
        // refund dust eth, if any
        if (msg.value > amounts[0]) TransferHelper.safeTransferETH(msg.sender, msg.value - amounts[0]);
    }

    // for multicall
    // must call refund or you will lose you money
    function swapETHForExactTokensMulti(uint amountOut, route[] calldata routes, address to, uint deadline)
    external
    virtual
    override
    payable
    ensure(deadline)
    returns (uint[] memory amounts)
    {
        require(routes[0].from == WETH, 'TeleswapV2Router: INVALID_PATH');
        amounts = getAmountsIn(amountOut, routes);
        IWETH(WETH).deposit{value : amounts[0]}();
        assert(IWETH(WETH).transfer(TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amounts[0]));
        _swap(amounts, routes, to);
    }

    // **** SWAP (supporting fee-on-transfer tokens) ****
    // requires the initial amount to have already been sent to the first pair
    function _swapSupportingFeeOnTransferTokens(route[] memory _routes, address _to) internal virtual {
        for (uint i; i < _routes.length; i++) {
            (address token0,) = TeleswapV2Library.sortTokens(_routes[i].from, _routes[i].to);
            ITeleswapV2Pair pair = ITeleswapV2Pair(TeleswapV2Library.pairFor(pairCodeHash, factory, _routes[i]));
            uint amountInput;
            uint amountOutput;
            uint reserveInput;
            uint reserveOutput;
            {// scope to avoid stack too deep errors
                (uint reserve0, uint reserve1,) = pair.getReserves();
                (reserveInput, reserveOutput) = _routes[i].from == token0 ? (reserve0, reserve1) : (reserve1, reserve0);
                amountInput = IERC20(_routes[i].from).balanceOf(address(pair)).sub(reserveInput);
            }
            {
                uint decimalIn = IERC20(_routes[i].from).decimals();
                uint decimalOut = IERC20(_routes[i].to).decimals();
                amountOutput = getAmountOut(amountInput, reserveInput, reserveOutput, _routes[i].stable, decimalIn, decimalOut);
            }
            (uint amount0Out, uint amount1Out) = _routes[i].from == token0 ? (uint(0), amountOutput) : (amountOutput, uint(0));
            address to = i < _routes.length - 1 ? TeleswapV2Library.pairFor(pairCodeHash, factory, _routes[i + 1]) : _to;
            pair.swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        route[] calldata routes,
        address to,
        uint deadline
    ) external virtual override ensure(deadline) {
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amountIn
        );
        uint balanceBefore = IERC20(routes[routes.length - 1].to).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(routes, to);
        require(
            IERC20(routes[routes.length - 1].to).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT'
        );
    }

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint amountOutMin,
        route[] calldata routes,
        address to,
        uint deadline
    )
    external
    virtual
    override
    payable
    ensure(deadline)
    {
        require(routes[0].from == WETH, 'TeleswapV2Router: INVALID_PATH');
        require(amountIn <= msg.value, 'TeleswapV2Router: INVALID_MSG_VALUE');
        IWETH(WETH).deposit{value : amountIn}();
        assert(IWETH(WETH).transfer(TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amountIn));
        uint balanceBefore = IERC20(routes[routes.length - 1].to).balanceOf(to);
        _swapSupportingFeeOnTransferTokens(routes, to);
        require(
            IERC20(routes[routes.length - 1].to).balanceOf(to).sub(balanceBefore) >= amountOutMin,
            'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT'
        );
    }

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        route[] calldata routes,
        address to,
        uint deadline
    )
    external
    virtual
    override
    ensure(deadline)
    {
        require(routes[routes.length - 1].to == WETH, 'TeleswapV2Router: INVALID_PATH');
        TransferHelper.safeTransferFrom(
            routes[0].from, msg.sender, TeleswapV2Library.pairFor(pairCodeHash, factory, routes[0]), amountIn
        );
        _swapSupportingFeeOnTransferTokens(routes, address(this));
        uint amountOut = IERC20(WETH).balanceOf(address(this));
        require(amountOut >= amountOutMin, 'TeleswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT');
        IWETH(WETH).withdraw(amountOut);
        TransferHelper.safeTransferETH(to, amountOut);
    }

    // **** LIBRARY FUNCTIONS ****
    function quote(uint amountA, uint reserveA, uint reserveB) public pure virtual override returns (uint amountB) {
        return TeleswapV2Library.quote(amountA, reserveA, reserveB);
    }

    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut, bool stable, uint decimalIn, uint decimalOut)
    public
    pure
    virtual
    override
    returns (uint amountOut)
    {
        return TeleswapV2Library.getAmountOut(amountIn, reserveIn, reserveOut, stable, decimalIn, decimalOut);
    }

    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut, bool stable, uint decimalIn, uint decimalOut)
    public
    pure
    virtual
    override
    returns (uint amountIn)
    {
        return TeleswapV2Library.getAmountIn(amountOut, reserveIn, reserveOut, stable, decimalIn, decimalOut);
    }

    function getAmountsOut(uint amountIn, route[] memory _routes)
    public
    view
    virtual
    override
    returns (uint[] memory amounts)
    {
        uint[] memory decimals = new uint[](_routes.length + 1);
        // query all decimals
        decimals[0] = IERC20(_routes[0].from).decimals();
        for (uint i; i < _routes.length; i++) {
            decimals[i + 1] = IERC20(_routes[i].to).decimals();
        }
        return TeleswapV2Library.getAmountsOut(factory, amountIn, _routes, decimals);
    }

    function getAmountsIn(uint amountOut, route[] memory _routes)
    public
    view
    virtual
    override
    returns (uint[] memory amounts)
    {
        uint[] memory decimals = new uint[](_routes.length + 1);
        // query all decimals
        decimals[0] = IERC20(_routes[0].from).decimals();
        for (uint i; i < _routes.length; i++) {
            decimals[i + 1] = IERC20(_routes[i].to).decimals();
        }

        return TeleswapV2Library.getAmountsIn(factory, amountOut, _routes, decimals);
    }

    function multicall(uint256 deadline, bytes[] calldata data)
    external
    payable
    override
    ensure(deadline)
    returns (bytes[] memory results)
    {
        results = new bytes[](data.length);
        for (uint256 i = 0; i < data.length; i++) {
            (bool success, bytes memory result) = address(this).delegatecall(data[i]);
            if (!success) {
                // Next 5 lines from https://ethereum.stackexchange.com/a/83577

                if (result.length < 68) revert();
                assembly {
                    result := add(result, 0x04)
                }
                revert(abi.decode(result, (string)));
            }

            results[i] = result;
        }
    }

    function refundETH() external payable override {
        if (address(this).balance > 0) TransferHelper.safeTransferETH(msg.sender, address(this).balance);
    }

}

